import './App.css';
import axios from 'axios';
import {useEffect} from 'react';
function App() {
  useEffect(() => {
    axios.get("http://localhost:9192/student").then((response)=>{
      console.log(response.data);
    });
  }, []);

  return (
    <div className="App">
    </div>
  );
}

export default App;
